import { useNavigate } from "react-router-dom";

const Landing = () => {
  const navigate = useNavigate();
  const toViewer = () => {
    navigate("/viewer");
  };
  return (
    <div className="landing">
      <div className="">
        <h1>Interactive 3D Model Viewer</h1>
        <p>Welcome to our 3D Model Viewer!</p>
        <p>
          Our viewer allows you to upload GLB files and toggle <br />
          different lighting settings such as ambient, directional, and point
          lights.
          <br />
          Easily adjust background colors, model scales, and experience the
          dynamic rotation of models.
        </p>
        <p>Click the button to start</p>
        <button onClick={toViewer}>Start</button>
      </div>
    </div>
  );
};

export default Landing;
